import styled from 'styled-components'

export const MainTitle = styled.body`
    color: #FFF;
    letter-spacing: 3px;
    font-size: 40px;
`;

export const Div = styled.div`
    background-color: #000;
    height: 100%;
    margin: -10px;
    padding: 0;
`;
